import React from 'react'

class Codes extends React.Component {
    cBubbleSort = 'bubblesort';
    cInsertionSort = 'insertionsort';
    cMergeSort = 'mergesort';
    cQuickSort = 'quicksort';
    selectionSort = 'selectionsort';
}

export default Codes
